import React from 'react'
import NavBar from '../components/navbar';

function Main() {
    return (
        <div>
            <NavBar />
            This is a Next.js rendered page
            <button onClick={() => Router.push('/mission')}>
            Go to Mission</button>
        </div>
    )
}

export default Main;
